  useEffect(() => console.log(token), [token]);
  if (token !== SESSION.LOGGED_OUT) {
    return <Dashboard handleLogout={handleLogout} />;
  } else {
    return <Login handleLogin={handleLogin} />;
  }
};

export default MainScreen;
